const fetchOnlineDataFromAPI = () => {
    try {
      const response = fetch('http://localhost:8000/data');
      const data = response.json();
      console.log("inicio:", data)
      return data;
    } catch (error) {
      console.error('Error fetching data:', error);
      throw error
    }
  };

  export default fetchOnlineDataFromAPI
